import React,{useState,useEffect} from 'react';


export default function InvestorCard({imageURL,href,alt}){

  //custom styling 
  const style={
    card:{
        minHeight:'175px',
        minWidth:"350px",
        maxWidth:'350px',
        border:'none',
        margin:'20px 0px'
    },
    img:{
        maxWidth:'200px'
    }
  }


    return(



        <div 

        className=' card offset-6 bg-white  pt-2 pb-2 pl-4 pr-4 justify-content-center  border border-light rounded bg-white shadow-lg '>

        <a className="d-flex justify-content-center"href={href}>
            <img 
            style={style.img}
              src={imageURL} 
              className="card-img-top img-rounded h-100"
              alt={alt}
            />
        </a>


  </div>

    )
}
